import React from "react";
import featureimage from "../Images/Frame 19.png";

const Features = () => {
  return (
    <div id="features">
      <div className="features-model">
        <img src={featureimage}></img>
      </div>
      <div className="feature"></div>
    </div>
  );
};

export default Features;
